function Categories() {
    return (
      <div class="categories">
      <ul>
        <li>Все</li>
        <li>Мясные</li>
        <li>Вегетарианская</li>
        <li>Гриль</li>
        <li>Острые</li>
        <li>Закрытые</li>
      </ul>
    </div>
    );
  }
  export default Categories;
